jQuery(document).ready(function(){
    Tree.init();

    $(document).on('click', '.modal-header button, .modal-footer button', function (e) {
        var url = Core.delPrm("id_tree");

        $(document).height($(window).height());
        window.history.pushState(url, '', url);
    });

});

